import "./Footer.css"
import {BsGithub} from 'react-icons/fa';

const Footer = () => {
    return ( 
        <div className="footer">
            <ul className="footer-divider">
                <li> <span className="name">Avihay Maman</span> </li>
                <li> <a href="https://github.com/AvihayM6" target="_blank" rel="noreferrer">{<BsGithub />}</a> </li>
                <li> <a href="https://www.avihaymaman.com/" target="_blank" rel="noreferrer">Portfolio</a> </li>
            </ul>
        </div>
     );
}

export default Footer;
